* The product of the roots is given by: \\(r_1 r_2 \\cdots r_n = \\frac{66}{2} = 33\\)
* The sum of the roots is given by: \\(r_1 + r_2 + \\cdots + r_n = -\\frac{a_{n-1}}{2}\\)

Since 33 factors as 1 × 3 × 11, the integer roots must be some permutation of 1, 3, and 11 (or their negatives).  The possible sets of roots are permutations of:

* {1, 3, 11}
* {-1, -3, 11}
* {-1, 3, -11}
* {1, -3, -11}
* {1, 3, -11}
* {-1, -3, -11}

Let's consider the sum of the roots in each case:

* {1, 3, 11}: 1 + 3 + 11 = 15  => \\(a_{n-1} = -2(15) = -30\\)
* {-1, -3, 11}: -1 + (-3) + 11 = 7  => \\(a_{n-1} = -2(7) = -14\\)
* {-1, 3, -11}: -1 + 3 + (-11) = -9 => \\(a_{n-1} = -2(-9) = 18\\)
* {1, -3, -11}: 1 + (-3) + (-11) = -13 => \\(a_{n-1} = -2(-13) = 26\\)
* {1, 3, -11}: 1 + 3 + (-11) = -7 => \\(a_{n-1} = -2(-7) = 14\\)
* {-1, -3, -11}: -1 + (-3) + (-11) = -15 => \\(a_{n-1} = -2(-15) = 30\\)

The possible values of \\(|a_{n-1}|\\) are 14, 18, 26, 30.  The least possible value is 14.

